import React from "react";
import { Input } from "antd";

const { Search } = Input;

function Home() {
  const onSearch = (e) => {
    console.log(e.target.value);
  };
  return (
    <div>
      <Search
        placeholder="input search text"
        allowClear
        enterButton="Search"
        size="large"
        onSearch={onSearch}
      />
    </div>
  );
}

export default Home;
